//This is an example code for Navigator// 
import React, { Component } from 'react';
//import react in our code. 
import { StyleSheet, View, Button, Pressable} from 'react-native';
//import all the components we are going to use.
import { TouchableHighlight } from 'react-native-web'; 

export default class FirstPage extends Component {
  static navigationOptions = {
    title: 'EZ Stocks',
    //Sets Header text of Status Bar
    headerStyle: {
      backgroundColor: '#1c0b24',
      //Sets Header color
    },
    headerTintColor: '#fff',
    //Sets Header text color
    headerTitleStyle: {
      fontWeight: 'bold',
      color: 'white'
      // align: 'center',
      //Sets Header text style
    },
  };

  render() {
    const { navigate } = this.props.navigation;
    return (

    <View style={styles.container}>


<TouchableHighlight 
                style ={{
                    height: 40,
                    width: 200,
                    borderRadius:10,
                    backgroundColor : "red",
                    marginLeft :50,
                    marginRight:50,
                    marginTop :20
                }}>
    <Button title='Go to second page'
      onPress={() =>navigate('SecondPage')}

      > </Button>
</TouchableHighlight> 



        <Button style={styles.button} title='Go to thirds page'
      onPress={() =>navigate('ThirdPage')}

      > Third Page</Button>



    </View>
    );
  }
}
const styles = StyleSheet.create({

  container: {
    flex: 1,
    backgroundColor: '#1c0b24',
    alignItems: 'center',
    justifyContent: 'center',
  },
  button: {
    alignItems: 'center',
    width: 200,
    justifyContent: 'center',
    paddingVertical: 12,
    marginTop: 15,
    paddingHorizontal: 32,
    borderRadius: 4,
    elevation: 3,
    backgroundColor: '#d90f8e',
  },
  text1: {
    fontSize: 15,
  },
});
